            .transition {
              transition-property: color, background-color, border-color,
                text-decoration-color, fill, stroke, opacity, box-shadow,
                transform, filter, -webkit-backdrop-filter;
              transition-property: color, background-color, border-color,
                text-decoration-color, fill, stroke, opacity, box-shadow,
                transform, filter, backdrop-filter;
              transition-property: color, background-color, border-color,
                text-decoration-color, fill, stroke, opacity, box-shadow,
                transform, filter, backdrop-filter, -webkit-backdrop-filter;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-\[width\] {
              transition-property: width;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-all {
              transition-property: all;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-colors {
              transition-property: color, background-color, border-color,
                text-decoration-color, fill, stroke;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-opacity {
              transition-property: opacity;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-transform {
              transition-property: transform;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .duration-200 {
              transition-duration: 0.2s;
            }
            .duration-300 {
              transition-duration: 0.3s;
            }
            .duration-500 {
              transition-duration: 0.5s;
            }
            .duration-75 {
              transition-duration: 75ms;
            }
            .ease-\[cubic-bezier\(0\.2\,0\.3\,0\.1\,1\.2\)\] {

            }
            .ease-\[cubic-bezier\(0\.2\,0\.3\,0\.2\,3\)\] {
              transition-timing-function: cubic-bezier(0.2, 0.3, 0.2, 3);

            .transition {
              transition-property: color, background-color, border-color,
                text-decoration-color, fill, stroke, opacity, box-shadow,
                transform, filter, -webkit-backdrop-filter;
              transition-property: color, background-color, border-color,
                text-decoration-color, fill, stroke, opacity, box-shadow,
                transform, filter, backdrop-filter;
              transition-property: color, background-color, border-color,
                text-decoration-color, fill, stroke, opacity, box-shadow,
                transform, filter, backdrop-filter, -webkit-backdrop-filter;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-\[width\] {
              transition-property: width;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-all {
              transition-property: all;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-colors {
              transition-property: color, background-color, border-color,
                text-decoration-color, fill, stroke;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-opacity {
              transition-property: opacity;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-transform {
              transition-property: transform;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .duration-200 {
              transition-duration: 0.2s;
            }
            .duration-300 {
              transition-duration: 0.3s;
            }
            .duration-500 {
              transition-duration: 0.5s;
            }
            .duration-75 {
              transition-duration: 75ms;
            }
            .ease-\[cubic-bezier\(0\.2\,0\.3\,0\.1\,1\.2\)\] {

            }
            .ease-\[cubic-bezier\(0\.2\,0\.3\,0\.2\,3\)\] {
              transition-timing-function: cubic-bezier(0.2, 0.3, 0.2, 3);

            .transition {
              transition-property: color, background-color, border-color,
                text-decoration-color, fill, stroke, opacity, box-shadow,
                transform, filter, -webkit-backdrop-filter;
              transition-property: color, background-color, border-color,
                text-decoration-color, fill, stroke, opacity, box-shadow,
                transform, filter, backdrop-filter;
              transition-property: color, background-color, border-color,
                text-decoration-color, fill, stroke, opacity, box-shadow,
                transform, filter, backdrop-filter, -webkit-backdrop-filter;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-\[width\] {
              transition-property: width;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-all {
              transition-property: all;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-colors {
              transition-property: color, background-color, border-color,
                text-decoration-color, fill, stroke;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-opacity {
              transition-property: opacity;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .transition-transform {
              transition-property: transform;
              transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
              transition-duration: 0.15s;
            }
            .duration-200 {
              transition-duration: 0.2s;
            }
            .duration-300 {
              transition-duration: 0.3s;
            }
            .duration-500 {
              transition-duration: 0.5s;
            }
            .duration-75 {
              transition-duration: 75ms;
            }
            .ease-\[cubic-bezier\(0\.2\,0\.3\,0\.1\,1\.2\)\] {

            }
            .ease-\[cubic-bezier\(0\.2\,0\.3\,0\.2\,3\)\] {
              transition-timing-function: cubic-bezier(0.2, 0.3, 0.2, 3);
